import React, { useMemo } from "react"
import { ReactSVG } from "react-svg"
import { Image } from "rebass"
import { baseUrl } from "../../utils/helper"

export default props => {
	const { width, svgUrl, shadowUrl, type } = props
	return (
		<div
			style={{
				position: "relative"
			}}
		>
			<Image
				src={baseUrl + shadowUrl}
				sx={{
					width: { width },
					minWidth: "14px",
					minHeight: "14px",
					position: "absolute"
				}}
			/>
			<ReactSVG
				style={{
					width: { width },
					minWidth: "14px",
					minHeight: "14px"
				}}
				renumerateIRIElements={false}
				loading={() => {
					console.log("loading")
					return "loading"
				}}
				evalScripts="always"
				src={baseUrl + svgUrl}
			></ReactSVG>
		</div>
	)
}
